import React from "react";
import Header from "./Header";
import Providers from "../providers/Providers.comp";

const Forge = () => {
    return(
        <Providers>
            <Header/>
            <section>
                <h1>Forge en construction...</h1>
                <img src = "Forge_full.png" id = "Forge" alt = ""/>
            </section>
        </Providers>
    )
}

export default Forge
